export default function FooterEnd(){
    return(
        <div className="end">
            <p>SERVICES CLIENTS</p>
            <p><IconTelephone /> +225 07 68 74 30 02</p>
            <p><IconTelephone /> +225 07 68 74 30 02</p>
            <p><IconEnvelope /> info@email.com</p>
        </div>
    )
}
